import React from 'react';
import {Link } from 'react-router-dom';




const NavComponent = () => {
return (
<nav className="nav-extended">
    <div className="nav-wrapper">
    <div className="row">
            <Link to="/home" className="brand-logo" >Home</Link>
    </div>
    <div className="row">
            <div className="nav-content">
                <ul className="tabs tabs-transparent">
                    <li className="tab"><Link to="/" >Healing Circle</Link></li>
                    <li className="tab"><Link to="/create" >Heal Request</Link></li>
                    <li className="tab"><Link to="/user" >Create Healer</Link></li>
                    <li className="tab"><Link to="/instructions" >Instructions</Link></li>
                </ul>
            </div>
    </div>
    </div>    
</nav>

);

};

export default NavComponent;
